import React from "react";
import { useParams } from "react-router-dom";
import { useGetProductItemQuery } from "../../redux/productsApi";
import { ErrorPage } from "../ErrorPage";

export const SkuPage = () => {
  const { id } = useParams();
  const { title, description, discont_price, price, image } = product?.item
    ? product?.item
    : {};

  const disc_percent = (100 - (discont_price * 100) / price).toFixed(1);
  const { data: product, error, isLoading } = useGetProductItemQuery(id);
  return (
    <>
      {product?.item ? (
        <div>
          <h1>{title}</h1>
          <div>
            <div>
              <img src={`http://localhost:3333${image}`} alt={title} />
            </div>
            <div>
              <div>
                <div>
                  {discont_price ? (
                    <>
                      <p>
                        {discont_price}
                        <span>$</span>
                      </p>
                      <p>{price}$ </p>
                      <p> -{disc_percent}%</p>
                    </>
                  ) : (
                    <p>
                      {price}
                      <span>$</span>
                    </p>
                  )}
                </div>
                <button>To cart</button>
              </div>
              <div>
                <p>Description</p>
                <p>{description}</p>
              </div>
              <div>{description}</div>
            </div>
          </div>
        </div>
      ) : (
        <ErrorPage />
      )}
    </>
  );
};
